import React from "react";
import styled from "styled-components";

const Nav = styled.section`
  width: 100vw;
  height: 5vh;
  position: relative;

  display: flex;
  justify-content: flex-end;
  align-items: center;

  background-color: var(--darkGrey);
  overflow: hidden;
`;

export const Navbar = () => {
  return (
    <>
      <div>Navbar</div>
    </>
  );
};
